import React from "react";
import { Github, Linkedin, Twitter, Mail, ShieldCheck, Heart, Sparkle } from "lucide-react";
import { motion } from "framer-motion";

const Footer: React.FC = () => {
  const year = new Date().getFullYear();

  const socialLinks = [
    { icon: Github, url: "https://github.com/", label: "GitHub", color: "hover:bg-slate-900" },
    { icon: Linkedin, url: "https://linkedin.com/", label: "LinkedIn", color: "hover:bg-blue-600" },
    { icon: Twitter, url: "https://twitter.com/", label: "Twitter", color: "hover:bg-sky-500" },
    { icon: Mail, url: "mailto:info@collabryta.com", label: "Email", color: "hover:bg-rose-500" },
  ];

  const sections = [
    {
      title: "Product",
      links: [
        { name: "Features", url: "/features" },
        { name: "Integrations", url: "#" },
        { name: "Pricing", url: "#" },
        { name: "Changelog", url: "#" },
      ],
    },
    {
      title: "Company",
      links: [
        { name: "About Us", url: "/about" },
        { name: "Careers", url: "#" },
        { name: "Blog", url: "#" },
        { name: "Contact", url: "/support" },
      ],
    },
    {
      title: "Resources",
      links: [
        { name: "Documentation", url: "/docs" },
        { name: "Help Center", url: "/support" },
        { name: "Community", url: "#" },
        { name: "Privacy Policy", url: "#" },
      ],
    },
  ];

  return (
    <footer className="w-full bg-white/30 backdrop-blur-xl border-t border-white/60 pt-24 pb-12 px-6 sm:px-12 overflow-hidden relative">
      {/* ðŸ”® Glass Background Decor */}
      <div className="absolute top-0 right-0 w-[40%] h-[100%] bg-gradient-to-l from-blue-100/20 to-transparent pointer-events-none" />
      <div className="absolute top-0 left-0 w-[40%] h-[100%] bg-gradient-to-r from-rose-100/10 to-transparent pointer-events-none" />

      <div className="max-w-7xl mx-auto relative z-10">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-5 gap-20 mb-20">
          {/* Logo & Brand Info */}
          <div className="lg:col-span-2 space-y-10">
            <div className="flex flex-col gap-4">
              <div className="flex items-center gap-4">
                <div className="w-12 h-12 bg-gradient-to-tr from-blue-600 to-indigo-600 rounded-2xl flex items-center justify-center shadow-xl shadow-blue-200 border border-white/40">
                  <img src="/logo1.png" alt="Logo" className="w-7 h-7 invert brightness-0" />
                </div>
                <div>
                  <h2 className="text-4xl font-black tracking-tighter text-slate-900">Collabryta</h2>
                  <div className="flex items-center gap-2 mt-1">
                    <span className="w-2 h-2 bg-emerald-500 rounded-full animate-pulse" />
                    <span className="text-[10px] font-black uppercase tracking-widest text-slate-400">Systems Active</span>
                  </div>
                </div>
              </div>
            </div>
            <p className="text-slate-500 text-sm leading-relaxed font-semibold max-w-sm">
              Experience the pinnacle of collaboration. Our frosted glass interface reflects our commitment to transparency and modern engineering excellence.
            </p>
            <div className="flex items-center gap-4">
              {socialLinks.map(({ icon: Icon, url, label, color }) => (
                <motion.a
                  key={label}
                  href={url}
                  target="_blank"
                  rel="noopener noreferrer"
                  whileHover={{ y: -8, scale: 1.1 }}
                  className={`p-3.5 rounded-2xl bg-white/60 backdrop-blur-md border border-white text-slate-400 hover:text-white ${color} transition-all duration-300 shadow-lg shadow-slate-200/50`}
                >
                  <Icon size={20} />
                </motion.a>
              ))}
            </div>
          </div>

          {/* Nav Sections */}
          {sections.map((section) => (
            <div key={section.title} className="space-y-10">
              <h3 className="text-xs font-black uppercase tracking-[0.3em] text-slate-900 border-b border-indigo-500/20 pb-4 inline-block">{section.title}</h3>
              <ul className="space-y-6">
                {section.links.map((link) => (
                  <li key={link.name}>
                    <a
                      href={link.url}
                      className="text-slate-500 text-sm font-bold hover:text-blue-600 transition-colors flex items-center gap-2 group"
                    >
                      <span className="w-1.5 h-1.5 rounded-full bg-blue-500/0 group-hover:bg-blue-500 transition-all scale-0 group-hover:scale-100" />
                      {link.name}
                    </a>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>

        {/* Bottom Line */}
        <div className="pt-12 border-t border-white/60 flex flex-col md:flex-row justify-between items-center gap-10">
          <div className="flex items-center gap-3">
            <div className="p-2 bg-white/80 rounded-xl shadow-sm border border-white">
              <ShieldCheck size={20} className="text-emerald-500" />
            </div>
            <div>
              <p className="text-[10px] font-black uppercase tracking-widest text-slate-400">Security Layer</p>
              <p className="text-xs font-black text-slate-700">AES-256 ENCRYPTED</p>
            </div>
          </div>

          <div className="flex flex-col items-center gap-1">
            <p className="text-sm font-black text-slate-900 tracking-tighter">
              COLLABRYTA <span className="text-blue-600 font-bold italic">GEN-3</span>
            </p>
            <p className="text-[10px] font-black text-slate-400 uppercase tracking-[0.2em]">Â© {year} Premium Light Theme</p>
          </div>

          <div className="flex items-center gap-3">
            <div className="p-2.5 bg-rose-500/5 rounded-2xl border border-rose-500/10">
              <Heart size={18} className="text-rose-500 fill-rose-500 animate-pulse" />
            </div>
            <div>
              <p className="text-[10px] font-black uppercase tracking-widest text-slate-400">Built with Love</p>
              <p className="text-xs font-black text-slate-700">FOR THE WORLD</p>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
